const e=JSON.parse('{"key":"v-0310e2ce","path":"/reading/algorithm/offer_oriented/AL_DS/08_tree/08.4.html","title":"8.4 TreeSet和TreeMap的应用","lang":"zh-CN","frontmatter":{"title":"8.4 TreeSet和TreeMap的应用","date":"2023-09-12T00:00:00.000Z","category":["algorithm"]},"headers":[{"level":2,"title":"8.4.1 问题57: 值与下标只差均在给定范围内","slug":"_8-4-1-问题57-值与下标只差均在给定范围内","link":"#_8-4-1-问题57-值与下标只差均在给定范围内","children":[]},{"level":2,"title":"8.4.2 问题58: 日程表","slug":"_8-4-2-问题58-日程表","link":"#_8-4-2-问题58-日程表","children":[]},{"level":2,"title":"Reference","slug":"reference","link":"#reference","children":[]}],"git":{"updatedTime":1694640689000},"readingTime":{"minutes":0.7,"words":210},"filePathRelative":"reading/algorithm/offer_oriented/AL_DS/08_tree/08.4.md","localizedDate":"2023年9月12日","excerpt":"<p>若二叉搜索树有n个节点, 高度为h, 那么查找, 添加和删除操作的时间复杂度都是 O(h).</p>\\n<p>若二叉搜索树是平衡的, 那么高度近似logn.</p>\\n<p>在极端情况下, 每个节点只有一个子节点, 高度为<code>n-1</code>, 查找等操作就退化成<code>O(n)</code>.</p>\\n<p>因此是否平衡对二叉搜索树的效率影响很大.</p>\\n<p>Golang 中没有内建的TreeSet和TreeMap, 需引入三方库 <a href=\\"https://github.com/emirpasic/gods/tree/master\\" target=\\"_blank\\" rel=\\"noopener noreferrer\\">gods</a></p>"}');export{e as data};
